250	ty-producteurs	Ty Producteurs	2019-03-23 14:00:45.014903+01	2019-03-23 14:00:45.024266+01	t	Ty Producteurs, c’est de la vente directe de viande de porc et de charcuterie BBC, sans intermédiaires entre la naissance du porc et son abattage.\n\nLe 19 mars 2010, Patrice et Sébastien, éleveurs de porcs à Merlevenez et Kervignac, s’associent pour créer la SARL Ty Producteurs et se lancent dans la vente en direct de viande de porc et de produits charcutiers, sous forme de caissettes composées pratiquement à la demande du client, sur quelques marchés entourant la région de Lorient. Nous favorisons la vente locale et directe, et travaillons avec des partenaires locaux.\n\nTous les porcs transformés proviennent de chez Patrice et Sébastien, les patrons. Ils sont nourris aux céréales et aux graines de lin, ne contiennent ni additifs ni conservateurs, et sont labellisés Bleu Blanc Cœur.\n\nAujourd’hui, outre les colis, vous découvrirez sur nos marchés un rayon complet de viande et de charcuterie élaborée de manière artisanale à Kervignac.\nLa transformation des demi-carcasses s’effectue au laboratoire pour ensuite être vendue sur les marchés avec les camions, ou être distribuée par colis, sous vide ou vrac, sur commande 48h à l’avance.\n\nTy Producteurs fonctionne sur une base de vente directe, sans intermédiaires entre la naissance du porc et son abattage.\nNous fonctionnons grâce à la vente sur les marchés locaux autour du bassin de Lorient et de Vannes, et à la prise de commande par le client, directement par téléphone ou au laboratoire de fabrication.\n\nTous nos porcs sont certifiés BBC : il s’agit d’une licence spécifique à la qualité de la viande de porc, Bleu Blanc Cœur, imposant un cahier des charges strict pour l’élevage, spécialement sur l’alimentation à la graine de lin et aux céréales, pour que la viande soit riche OMEGA 3 (anciennement la Vitamine F).	Rôtis festifs - Chipolatas Ty Producteurs - Pâté de campagne Ty Producteurs et ses variantes (poivre vert, chouchen etc.) - Couscous Breton (joues et merguez de porcs) - Rost er forn - De nombreux colis parfaits pour toutes vos occasions à moindre prix	ZA Braigno	56700	Kervignac	56	FR	0101000020E61000000B293FA9F6E909C05227A089B0E14740	-	shop_images/250.png	+33297878328	typroducteurs@orange.fr	2	\N	5
