1	alsace	Alsace	2019-03-23 14:00:40.493748+01	2019-03-23 14:00:40.49377+01	0101000020E6100000C009850838C41D4029CB10C7BA284840	La plus petite des régions de France où les agriculteurs cultivent principalement la vigne et les grandes cultures comme les céréales. L’alsace dispose également de productions plus spécialisées qui participent à la réputation de sa gastronomie comme le houblon qui aromatise ses bières, le chou sans qui il n’y aurait pas de choucroute, ou encore les quetsches qui après fermentation et distillation produisent l’eau-de-vie. L’Alsace possède 842 produits sous appellation AOC/AOP. 840 sont des vins avec essentiellement des vins blancs secs ou secs tendres parfois élaborés en crémant sans oublier l’eau-de-vie Marc d’Alsace Gewurztraminer et le fromage Munster. Un quart des exploitations alsaciennes vendent en circuits courts.	16
2	aquitaine	Aquitaine	2019-03-23 14:00:40.499367+01	2019-03-23 14:00:40.499385+01	0101000020E6100000CE3637A6272CD3BF61545227A0594640	Première région de France en productions de vins sous AOC/AOP l’Aquitaine possède également de nombreux autres produits bénéficiant de signes de qualité. Des AOC comme les noix du Périgord, l’Ossau-Iraty, le Piment d’Espelette, des IGP tels que le Kiwi de l’Adour, le Jambon de Bayonne, les Asperges des sables des Landes, le Canard à foie gras du Sud-Ouest, les Fraises du Périgord ou le Pruneau d’Agen.	5
3	auvergne	Auvergne	2019-03-23 14:00:40.503392+01	2019-03-23 14:00:40.503407+01	0101000020E61000006E3480B740C20A406EA301BC05DA4640	La première prairie de France est occupée majoritairement par des troupeaux de Charolaise, Montbéliarde mais aussi Limousine ou Aubrac. Des éleveurs laitiers qui se sont engagés dans une démarche de qualité avec 8 fromages bénéficiant d’une AOC/AOP comme le Saint-Nectaire, le Cantal, le Salers, le Bleu d’Auvergne, la Fourme d’Ambert ou le Laguiol. La région possède une autre célèbre AOC/AOP, La Lentille verte du Puy.	6
4	bourgogne	Bourgogne	2019-03-23 14:00:40.507507+01	2019-03-23 14:00:40.507521+01	0101000020E6100000D4484BE5ED8811401F85EB51B8864740	Si les vignobles bourguignons occupent peu de surface agricole ils produisent quasiment que des vins sous AOC/AOP.  Ses grands crus réputés sont répartis sur les communes  de Chablis, de la Côte de Nuits et de la côte de Beaune. La région possède également d’autres fameux produits sous AOC/AOP comme la Dinde, le Chapon ou le Poulet de Bresse, le fromage de chèvre le Mâconnais ou encore l’Epoisses.	14
5	bretagne	Bretagne	2019-03-23 14:00:40.512334+01	2019-03-23 14:00:40.512372+01	0101000020E61000001288D7F50B7607C060E5D022DB194840	On connaît des légumes bretons les choux fleurs, les artichauts, peut-être moins les haricots blancs demi-secs Coco de Paimpol et les oignons de Roscoff tous deux des AOC/AOP. Le cidre de Bretagne, la Coquille Saint-Jacques des Côtes-d’Armor, la Farine de blé noir de Bretagne, les Volailles de Bretagne, l’apéritif à base de cidre le Pommeau de Bretagne, autant de produits qui bénéficient de signes de qualité.	11
6	centre	Centre	2019-03-23 14:00:40.518673+01	2019-03-23 14:00:40.518705+01	0101000020E61000007767EDB60BCDFA3F39D6C56D34E04740	La région Centre demeure le grenier de la France et possède encore la plus grande étendue de surfaces agricoles utilisées. Par la place qu’ils accordent aux cultures spécialisées comme les fruits et légumes, Le Loiret et l’Indre-et-Loire sont les 2 départements de la région qui pratiquent le plus la commercialisation en circuits courts. L’importance de ce mode de vente pour le miel et les légumes est primordiale	10
7	champagne-ardenne	Champagne-Ardenne	2019-03-23 14:00:40.524505+01	2019-03-23 14:00:40.52452+01	0101000020E6100000F98381E7DEE31140BD5296218E654840	L’aire géographique ou Champagne Viticole de l’AOC/AOP Champagne s’étend sur 3 des 4 départements de la région Champagne-Ardenne et totalise 33.000 hectares de vignes. En dehors de la viticulture, la Haute-Marne fabrique le fromage de Langres qui est une AOC/AOP. Les Ardennes, seul département de la région qui ne produit pas de Champagne élabore le Boudin blanc de Rethel et le Jambon sec des Ardennes.	18
8	corse	Corse	2019-03-23 14:00:40.528781+01	2019-03-23 14:00:40.528794+01	0101000020E610000011E4A08499062240F775E09C11054540	La Corse ou « la montagne dans la mer » dispose de peu de surface agricole compte tenu de son relief accidenté. Elle tire néanmoins avantage de ses particularités en conférant une forte identité à de nombreux produits et en ayant joué la carte de la qualité.  Des produits de charcuterie comme la Coppa, le Jambon sec et le Lonzo bénéficient d’une AOC.  C’est également le cas pour le vin Corse, le fromage Brocciu, le miel, la farine de châtaigne, l’huile d’olive. La quasi-totalité des agrumes français est récoltée en Corse et les clémentines bénéficient d’une Indication Géographique Protégée (IGP). Autre preuve de l’engagement des agriculteurs corses pour le respect de l’environnement, l’agriculture biologique connaît une forte progression dans la région.	0
9	franche-comte	Franche-Comté	2019-03-23 14:00:40.533112+01	2019-03-23 14:00:40.533126+01	0101000020E61000009FCDAACFD516184029ED0DBE30914740	L’élevage de bovins laitiers demeure la principale activité agricole régionale. La vache Montbéliarde, de très loin la race prédominante en Franche-Comté, est élevée pour son lait qui entre dans la fabrication du comté. La production agricole de la région compte de nombreux produits sous signe officiel de qualité. On peut citer les Vins d’Arbois, la Saucisse de Morteau, la Saucisse de Montbéliard, le Créman du Jura ou le Vacherin du Haut Doubs.	15
10	ile-de-france	Ile-de-France	2019-03-23 14:00:40.537575+01	2019-03-23 14:00:40.537599+01	0101000020E610000062F3716DA8180540696FF085C96C4840	Malgré une population qui avoisine les 12 millions de personnes la superficie agricole réussit à se maintenir et l’agriculture de la région renferme une richesse de productions inattendues. Les grandes cultures sont dominantes mais le maraîchage, l’élevage, les fleurs et l’horticulture résistent plutôt bien puisque la région est la première productrice de France de persil, de cresson ou d’azalées. Les élevages laitiers de Seine-et-Marne produisent deux fromages d’Appellation d’Origine Contrôlée : le Brie de Meaux et le Brie de Melun. Les exploitations qui pratiquent la vente en circuit court ne sont pas nombreuses. Etonnamment leur nombre diminue alors qu’elles cohabitent avec un bassin de consommation très important.	21
11	languedoc-roussillon	Languedoc-Roussillon	2019-03-23 14:00:40.543999+01	2019-03-23 14:00:40.54404+01	0101000020E6100000A9C1340C1F110A4096B20C71ACCB4540	Le Languedoc-Roussillon est la deuxième région de France en termes d’exploitations bio et peut s’enorgueillir de posséder le plus grand nombre de produits sous signes de qualité. La majorité sont des vins comme les Vins de Banyuls, le Muscat de Frontignan ou les Vins du Languedoc Pic Saint-Loup mais d’autres produits méritent tout aussi bien leur appellation comme l’Huile d’olive de Nîmes, l’Oignon doux des Cévennes, le Pélardon ou le Riz de Camargue	3
12	limousin	Limousin	2019-03-23 14:00:40.549525+01	2019-03-23 14:00:40.549555+01	0101000020E61000005BD3BCE3141DF93FC364AA6054F24640	Le Limousin est une région de production de viande. Bovine principalement, avec 2 races à viande, la Limousine et le Charolaise, mais aussi ovine. La majorité des brebis élevées dans la région profitent d’une Indication Géographique Protégée (IGP) et bénéficient ainsi d’une reconnaissance de sa qualité. L’élevage traditionnel porcin est en retrait malgré une longue tradition charcutière régionale mais près de la moitié de la production est réalisée sous signe officiel de la qualité et de l’origine. Le nom de la région est associé à pas mal de produits sous appellation : l’Agneau du Limousin (IGP), le Porc du Limousin (IGP), les Pommes du Limousin (AOC) ou encore Le Veau du Limousin (IGP).	7
13	lorraine	Lorraine	2019-03-23 14:00:40.555044+01	2019-03-23 14:00:40.555075+01	0101000020E6100000A27F828B15D51840ABCFD556EC6F4840	Les champs de colza ou de céréales très présents dans le nord de la Lorraine laissent place aux troupeaux et à la forêt lorsqu’on atteint le département des Vosges. Les abeilles recueillent et transforment le miellat des sapins du massif des Vosges en Miel de Sapin des Vosges qui bénéficie d’une Appellation d’Origine Contrôlée (AOC).  Même si les grandes cultures dominent l’agriculture lorraine la surface des vergers progresse alors que la tendance nationale est à la baisse. La culture fruitière dédiée aux prunes, pommes, cerises, ou poires produit les fameuses Mirabelles de Lorraine (IGP) à déguster avec ou sans modération suivant l’état dans lesquelles elles sont mangées, fraîches ou transformées en eau de vie.	17
14	midi-pyrenees	Midi-Pyrénées	2019-03-23 14:00:40.559954+01	2019-03-23 14:00:40.559974+01	0101000020E610000085B69C4B7155F83FFB5C6DC5FE0A4640	La plus vaste des régions de France est également celle qui compte le plus grand nombre d’exploitations agricoles. La culture de céréales comme le blé, d’oléagineux comme le colza et l’élevage sont les dominantes de son agriculture. La région offre une grande diversité de produits du terroir. Le Roquefort fabriqué avec le lait cru et entier des brebis élevées en Aveyron et dans le Tarn. Le raisin de table Chasselas de Moissac récolté sur les vignes du Bas-Quercy. Les Canards à foie gras du Gers, les Melons de Quercy, l’Ail rose de Lautrec, l’Haricot tarbais ou le Bleu des Causses. Les exploitations qui commercialisent leurs produits en circuit court le font principalement à la ferme ou sur les marchés. Les magasins de producteurs sont bien représentés dans le département de la Haute-Garonne.	4
15	nord-pas-de-calais	Nord-Pas-de-Calais	2019-03-23 14:00:40.563925+01	2019-03-23 14:00:40.563943+01	0101000020E610000028D53E1D8F590640A167B3EA733D4940	La plus au nord des régions de France est un territoire de grandes cultures dont les céréales occupent la plus grande partie des terres arables. Le Nord-Pas de Calais est aussi un gros producteur de légumes cultivés en plein champ. La majorité des choux de Bruxelles, petits pois, carottes, haricots verts se retrouvent en boite mais le marché du frais dont l’offre de produits est étoffée par les maraichers ne manque pas de diversité. Endives, choux-fleurs, poireaux, salades ou oignons, l’éventail est large. La région compte deux produits sous appellation AOC, le fromage à pâte molle Maroilles et la viande d’agneau Prés-salés de la baie de Somme. Des produits en IGP comme les Volailles de Licques, l’Ail fumé d’Arleux ou les Pommes de terre de Merville.	20
16	basse-normandie	Basse-Normandie	2019-03-23 14:00:40.56747+01	2019-03-23 14:00:40.567487+01	0101000020E610000037A6272CF180E0BFC6DCB5847C704840	La Basse-Normandie est avant tout une région productrice de lait de vache. C’est le pays d’origine du Pont l’Evêque et du Camembert, deux fromages reconnus AOC qui sont élaborés à partir du lait cru de vaches de race Normande. Les vaches pâturent plus de six mois par an et broutent sous les pommiers qui produisent le Calvados, une eau de vie élaborée à partir du cidre issu de fruits provenant de vergers traditionnels. Les agriculteurs de la région ne sont pas beaucoup investis dans les modes de commercialisation en circuit court. Peu de magasins de producteurs mais des exploitations pratiquent la vente directe à la ferme.	12
17	haute-normandie	Haute-Normandie	2019-03-23 14:00:40.572025+01	2019-03-23 14:00:40.572048+01	0101000020E6100000D28BDAFD2A40EC3FA5BDC11726C34840	Le climat humide et doux de la région est très favorable à l’agriculture. Des grandes cultures dans l’Eure, de l’élevage en Seine Maritime. Elle est la première région productrice de lin textile mais son nom reste associé aux produits laitiers comme le beurre ou la crème. La douceur des températures autorise une longue période de pâturage des troupeaux laitiers ce qui donne de fameux fromages.	13
18	pays-de-la-loire	Pays-de-la-Loire	2019-03-23 14:00:40.576053+01	2019-03-23 14:00:40.576072+01	0101000020E6100000033E3F8C101ED5BFB6847CD0B3E14740	Elle est la 2ème région française en surfaces bio avec plus de 2000 exploitations ayant adopté le mode de production biologique. Les 2 départements locomotive de cet engagement environnemental sont la Loire Atlantique et le Maine et Loire. Puisque l’agriculture de la région est orientée vers l’élevage, on retrouve tout naturellement une offre bio conséquente en volailles, oeufs et viande bovine. La plupart des produits des Pays-de-la-Loire sous Appellation d’Origine Protégée sont des alcools. La Mâche Nantaise bénéficie quant à elle d’une Indication Géographique Protégée tout comme ce haricot blanc sec vendéen,  la Mogette de Vendée.	9
19	picardie	Picardie	2019-03-23 14:00:40.580533+01	2019-03-23 14:00:40.580549+01	0101000020E610000061FD9FC37C39044014D044D8F0D44840	Même si la culture de la pomme de terre de consommation progresse au sein du territoire picard elle ne peut pas rivaliser dans le paysage avec les champs de colza, de blé ou de maïs. La Picardie est la région des grandes cultures, juste derrière l’Ile de France. Dans ce contexte les surfaces de cultures maraîchères, les vignes, les vergers sont bien marginales. Ces exploitations commercialisent leurs produits en circuit court, à la ferme ou sur les marchés	19
20	poitou-charentes	Poitou-Charentes	2019-03-23 14:00:40.585544+01	2019-03-23 14:00:40.585565+01	0101000020E610000028F224E99AC9D3BFCFF753E3A5F34640	Les produits phares en Poitou-Charentes sont nombreux, diversifiés, à l’image de l’agriculture de la région. Certains bénéficient d’un signe officiel de qualité et d’origine. Associé au nom de ses départements d’origine la région compte trois beurres sous AOP, le Beurre de Charentes-Poitou bien sur mais aussi le Beurre des Charentes et le Beurre des Deux Sèvres. La région est également célèbre pour ses Huîtres Marennes Oléron, son Pineau des Charentes, son Cognac, ses Vins d’Anjou, ses Melons du Haut-Poitou, ou encore pour le Chabichou du Poitou.La vente directe du producteur au consommateur est aussi pratiquée dans les  9 boutiques des Lycées agricoles de la région et les produits qu’on y trouve sont fonction des spécialités de chaque établissement.	8
21	provence-alpes-cote-dazur	Provence-Alpes-Côte-d’Azur	2019-03-23 14:00:40.590044+01	2019-03-23 14:00:40.590061+01	0101000020E6100000DA20938C9C4518400F9C33A2B4F74540	La préservation des espaces agricoles est devenue une priorité pour cette région où la pression démographique est très forte, particulièrement à proximité du littoral. La part du territoire agricole cultivé en bio est malgré tout la plus importante de France. Elle est également la première région française productrice de plantes aromatiques, médicinales et à parfum. Le département des Alpes-de-Haute-Provence concentre les trois-quarts de cette production avec la culture de la lavande et du lavandin. Les fruits et légumes, la vigne et l’élevage extensif d’ovins sont les autres points forts de l’agriculture provençale.  La région possède de nombreux produits dont la notoriété n’est plus à démontrer. Des vins comme les Côtes du Rhône ou les Côtes de Provence, les huiles d’olive d’Aix-en-Provence, de Nyons ou de Nice, le miel de Provence ou le fromage de chèvre le Picodon.	1
22	rhone-alpes	Rhône-Alpes	2019-03-23 14:00:40.594222+01	2019-03-23 14:00:40.594237+01	0101000020E6100000E92B483316CD154068B3EA73B5954640	Le Jura, le Massif Central et les Alpes dominées par le Mont Blanc sont les trois massifs montagneux qui caractérisent la région.  Les agriculteurs rhônalpiens se sont bien adaptés à ce relief accidenté, leur agriculture est variée et de qualité. De très nombreux produits sous appellation AOC/AOP sont là pour témoigner de leur démarche qualitative. Des fromages tels que l’Abondance ou le Beaufort, des vins comme le Crozes-hermitage ou la Côte Rôtie, les volailles de Bresse, les noix de Grenoble. La région possède également le plus grand nombre d’exploitations biologiques et toutes les productions sont concernées. Même Le tout premier magasin de producteurs a été créé en Rhône-Alpes et avec plus de quatre vingt magasins à l’heure actuelle son avance sur les autres régions est considérable.	2
